import oppo from '../Images/oppo.jpg';
import redme from '../Images/Redme.jpg';
import Button from 'react-bootstrap/Button';
import { Link, Outlet } from 'react-router-dom';
import React  from 'react';

// import Oppo from './oppo';
function Mobiles() {
    return (
        <div className="Product">
             <Outlet />
            <div className='oppo'>
           

                <img src={oppo} alt="React Image" className='img button' />
                <p>Oppo A17 (Sunlight Orange, <br></br>4GB RAM, 64GB Storage) with No Cost EMI/Additional Exchange Offers</p>
                <Link to='/Product/oppo'> <Button variant="warning" className='mx-5 mobile_button'>Buy</Button></Link>
            </div>
            <div className='redme'>
                <img src={redme} alt="React Image" className='img button' />
                <p>Redmi Note 11 (Horizon Blue, 6GB RAM, 128GB Storage)| Qualcomm® Snapdragon™ 680-6nm | 33W Charger Included</p>
               <Link to='/Product/Redme'> <Button variant="warning" className='mx-5 mobile_button'>Buy</Button></Link>

            </div>


        </div>

    );
}
export default Mobiles;
